import React from "react";
import { Typography, TextField } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles(() => ({
	root: {
		margin: "0 auto",
		width: "25%",
	},
	form: {
		width: "100%",
	},
	textField: {
		display: "block",
		width: "100%",
	},
}));

const SignUpPage = () => {
	const classes = useStyles();

	return (
		<div className={classes.root}>
			<Typography>Sign Up</Typography>
			<form>
				<TextField
					className={classes.textField}
					required
					id="firstName"
					label="First Name"
					fullWidth={true}
				/>
				<TextField
					className={classes.textField}
					required
					id="lastName"
					label="Last Name"
				/>
				<TextField
					className={classes.textField}
					required
					id="username"
					label="Username"
				/>
				<TextField
					className={classes.textField}
					required
					id="email"
					label="Email"
					type="email"
				/>
				<TextField
					className={classes.textField}
					required
					id="password"
					label="Password"
					type="password"
				/>
			</form>
		</div>
	);
};

export default SignUpPage;
